import { Component } from '@angular/core';
import { Router } from '@angular/router';
import { AgentregisterationService } from '../services/agentregisteration.service';
import { UserService } from '../services/user.service';
import { AuthService } from '../services/auth.service';

@Component({
  selector: 'app-agent-registration',
  templateUrl: './agent-registration.component.html',
  styleUrls: ['./agent-registration.component.scss']
})
export class AgentRegistrationComponent {
constructor(private router: Router,
  private authservice:AuthService){}

  onSubmit() {
  
    const formData = {
      username:"hello",
      email: (<HTMLInputElement>document.getElementById("email")).value,
      phoneNumber: (<HTMLInputElement>document.getElementById("phoneNumber")).value,
      password: (<HTMLInputElement>document.getElementById("password")).value,
      commision: (<HTMLInputElement>document.getElementById("commission")).value,
      companyType: (<HTMLInputElement>document.getElementById("companyType")).value,
      companyName: (<HTMLInputElement>document.getElementById("companyName")).value,
      status:"Not Verified",
      roles: ["mod"]


    };
    console.log("Form Data",formData);
    
     this.authservice.registerAgent(formData).subscribe((Response) => {
       console.log(Response);
       if (Response.status == 201 || Response.status==200) {
         console.log(Response['body']);
         this.router.navigateByUrl('/login');

         if (Response['body'].success) {
           console.log("Data is ", formData);
         } else {
           // Handle registration failure
         }
       } else {
         console.log("Error: ");
       }
     });
  }



}

<div class="col why-us-lead-form">
  <div class="lead-form">
    <H1>Agent Registeration Form</H1>
      <form>
          
        <div class="input-field">
            <label for="email">Email</label>
            <input type="email" id="email" name="email" placeholder="Enter Email" required>
        </div>
        <div class="input-field">
            <label for="phoneNumber">Phone Number</label>
            <input type="text" id="phoneNumber" name="phoneNumber" placeholder="Enter Phone Number" required>
        </div>
        <div class="input-field">
            <label for="password">Password</label>
            <input type="password" id="password" name="password" placeholder="Enter Password" required>
        </div>
        <div class="input-field">
            <label for="commission">Commission</label>
            <input type="number" id="commission" name="commission" placeholder="Enter Commission" required>
        </div>
        <div class="input-field">
            <label for="companyType">Company Type</label>
            <input type="text" id="companyType" name="companyType" placeholder="Enter Company Type" required>
        </div>
        <div class="input-field">
            <label for="companyName">Company Name</label>
            <input type="text" id="companyName" name="companyName" placeholder="Enter Company Name">
        </div>
          <p>
              <input type="button" id="registerAgentBtn" value="Register Agent" (click)="onSubmit()">
          </p>
      </form>
  </div>
</div>
